import Paper from "@material-ui/core/Paper";
import { ViewState } from "@devexpress/dx-react-scheduler";
import { WeekView } from '@devexpress/dx-react-scheduler-material-ui';

import {
    Scheduler,
    DayView,
    Appointments,
} from "@devexpress/dx-react-scheduler-material-ui";
const LeftDisplay = () => {
    const currentDate = "2018-11-01";
    const schedulerData = [
        {
          title: 'Website Re-Design Plan',
          priorityId: 2,
          startDate: new Date(2021, 3, 30, 9, 30),
          endDate: new Date(2018, 4, 3, 11, 30),
          id: 0,
        }, {
          title: 'Book Flights to San Fran for Sales Trip',
          priorityId: 1,
          startDate: new Date(2018, 4, 10, 10, 0),
          endDate: new Date(2018, 4, 10, 12, 0),
          id: 1,
        }
    ];
    return (
        <>
   <Paper>
    <Scheduler data={schedulerData} height={660}>
      <WeekView startDayHour={9} endDayHour={21} />
      <Appointments />
    </Scheduler>
  </Paper>
        </>
    );
};

export default LeftDisplay;

